import React from "react";

const ItemPage = (props) => {
  const itemId = props.match.params.id;
  const item = props.clothes.find((item) => {
    item.name.includes(itemId);
  });
  return (
    <>
      <h1>Hello World</h1>
    </>
  );
};

export default ItemPage;
